import React, { useState } from "react";
import Form from "./Form";

function MemberList(props) {
  const team = props.data;

  return (
    <>
      {team.map((member, index) => (
        <Form>
          Name: {props.name}
          Email: {props.email}
          Role: {props.role}
        </Form>
      ))}
    </>
  );
}

export default MemberList;
